import React from 'react';

const ScreenPlanet = (props) => {

	const planet = props.planet

	const screen = (
		<div>
		{planet.id}
		</div>
	)

	return (

		<div className={planet.infoToggle ? 'screen flex' : 'screen'}>
		{screen}
		</div>

	)
}
export default ScreenPlanet;
